import "./Projects.css";
import gymicon from "/Users/doinacolun/Desktop/personal_portfolio/my-app1/src/images/gymicon.jpg"

const Projects = () => {
    return (
        <div className="projects">
            <h1>My Projects</h1>
            <div className="projects-wrapper">
                <fast-card class="first-card">
                    <img src={gymicon}/>
                    <div className="1st-card">
                        <h2>My next gym</h2>
                        <p>Technologies: Python, Flask, PostgreSQL, Google Maps API, React, HTML, CSS, JavaScript, Git</p>
                        <button onclick="window.location.href='https://github.com/doinyco/Frontend-nextgym';">Demo</button>
                        <form>
                            <input type="button" onclick="window.location.href='https://www.w3docs.com';" value="w3docs" />
                        </form>
                    </div>
                </fast-card>
            </div>
        </div>
    );
};

export default Projects;
